INSERT INTO `basis_pengetahuans` (`id`, `judul`, `path_gambar`, `deskripsi`, `created_at`, `updated_at`) VALUES
(1,	'Tembakau',	'images/basispengetahuan\\1668926716-Tembakau.jpg',	'Tembakau adalah kelompok tumbuhan dari genus Nicotiana yang daunnya biasa digunakan sebagai bahan baku dalam kegiatan merokok. Bahasa Indonesia tembakau merupakan serapan dari kata \"tabaco\" dari Bahasa Spanyol yang dianggap sebagai asal kata.',	'2022-11-19 23:44:06',	'2022-11-19 23:45:16'),
(2,	'Daun',	'images/basispengetahuan\\1668926899-Daun.jpg',	'Produksi tembakau terbesar berasal dari spesies Nicotiana tabacum, meskipun Nicotiana rustica juga digunakan di beberapa tempat.',	'2022-11-19 23:48:19',	'2022-11-19 23:48:19');
